       id="text178"><tspan
         
         y="0"
         id="tspan176">Aarø Camping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,583.7945)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text186"><tspan
         
         y="0"
         id="tspan180">Aarø, et rigtigt ø-samfund, hvor fred og ro hersker og </tspan><tspan
         
         y="11.997"
         id="tspan182">hvor der er plads til alle. Du får campingvognen gratis </tspan><tspan
         
         y="23.993999"
         id="tspan184">med færgen!</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,532.0333)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text190"><tspan
         
         y="0"
         id="tspan188">Albertinelund Camping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,517.1987)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text200"><tspan
         
         y="0"
         id="tspan192">Pladsen er beliggende på Djurslands nordkyst, lige ned </tspan><tspan
         
         y="11.997"
         id="tspan194">til meget børnevenlig sandstrand, i noget af Danmarks </tspan><tspan
         
         y="23.993999"
         id="tspan196">skønneste natur. Kun få kilometer fra Bønnerup Strands </tspan><tspan
         
         y="35.991001"
         id="tspan198">fiskeri- og lystbådehavn.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,453.4375)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text204"><tspan
         
         y="0"
         id="tspan202">Asaa Camping &amp; Hytteferie</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,438.6028)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text210"><tspan
         
         y="0"
         id="tspan206">Én lille oase – én stor familie. Slap af og nyd stilheden </tspan><tspan
         
         y="11.997"
         id="tspan208">i vores lille, naturskønne og idylliske oase.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,398.8416)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text214"><tspan
         
         y="0"
         id="tspan212">Assentorp Camping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,384.007)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text222"><tspan
         
         y="0"
         id="tspan216">Velkommen til Assentorp Camping. En plads beliggende </tspan><tspan
         
         y="11.997"
         id="tspan218">i unik natur, med masser af aktivitetsmuligheder på </tspan><tspan
         
         y="23.993999"
         id="tspan220">pladsen og i nærheden.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,332.2458)"

       id="text226"><tspan
         
         y="0"
         id="tspan224">Augustenhof Strand Camping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,317.4111)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text234"><tspan
         
         y="0"
         id="tspan228">Direkte ned til stranden og omgivet af den skønneste </tspan><tspan
         
         y="11.997"
         id="tspan230">natur ligger Augustenhof Strand Camping på nordsiden </tspan><tspan
         
         y="23.993999"
         id="tspan232">af Als.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,265.65)"

         y="0"
         id="tspan236">Auning Camping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,250.8153)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text248"><tspan
         
         y="0"
         id="tspan240">Djurslands hyggeligste familiecamping med nem </tspan><tspan
         
         y="11.997"
         id="tspan242">og billig adgang til indendørs svømmecenter… En </tspan><tspan
         
         y="23.993999"
         id="tspan244">pragtfuld oase for ferie med børn ... Og så er det </tspan><tspan
         
         y="35.991001"
         id="tspan246">camping, der er til at betale.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,187.0541)"

    <text
       xml:space="preserve"

       id="text258"><tspan
         
         y="0"
         id="tspan254">Pladsen ligger i det smukke, karakteristiske marskland, </tspan><tspan
         
         y="11.997"
         id="tspan256">direkte ved vadehavet med udsigt over vandet.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,132.4583)"

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,77.6122,117.6236)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text272"><tspan
         
         y="0"
         id="tspan264">Pladsen ligger direkte ned til Gudenåen, størstedelen </tspan><tspan
         
         y="11.997"
         id="tspan266">af pladserne har fin udsigt over Gudenåen. Der </tspan><tspan
         
         y="23.993999"
         id="tspan268">tilbydes 305 meter med frit fiskeri samt mulighed for </tspan><tspan
         
         y="35.991001"
         id="tspan270">fantastiske kanoture i Gudenåen.</tspan></text>

    <text
       xml:space="preserve"

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text396"><tspan
         
         y="0"
         id="tspan390">Billund Camping har åbent hele året. Mindre end </tspan><tspan
         
         y="11.997"
         id="tspan392">500 m fra LEGOLAND® og dør om dør med Lalandia </tspan><tspan
         
         y="23.993999"
         id="tspan394">Billund.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,344.0689,610.6292)"

       id="text400"><tspan
         
         y="0"
         id="tspan398">Bjerregaard Camping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,344.0689,595.7945)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text410"><tspan
         
         y="0"
         id="tspan402">Naturskøn campingplads beliggende syd for Hvide </tspan><tspan
         
         y="11.997"
         id="tspan404">Sande, storslået udsigt over Ringkøbing Fjord, med </tspan><tspan
         
         y="23.993999"
         id="tspan406">egen strand. Kun 10 minutters gang til Vesterhavet. </tspan><tspan
         
         y="35.991001"
         id="tspan408">6 forskellige hyttetyper samt luksus mobile homes.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,344.0689,532.0333)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text414"><tspan
         
         y="0"
         id="tspan412">Blokhus Klit Camping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,344.0689,517.1987)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text422"><tspan
         
         y="0"
         id="tspan416">Moderne familieplads med plads til det hele – hvad </tspan><tspan

       id="text164"><tspan

         id="tspan162">Camp Hverringe, Bøgebjerg Strand</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,760.3274)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text170"><tspan
         
         y="0"
         id="tspan166">Udsigt og omgivelser, der gør pladsen til én af Europas </tspan><tspan
         
         y="11.997"
         id="tspan168">bedste.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,720.5662)"

       id="text174"><tspan
         
         y="0"
         id="tspan172">Camping &amp; Feriecenter Ristinge</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,705.7315)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text182"><tspan
         
         y="0"
         id="tspan176">Ristinge sommerCamp ligger i en meget smuk natur </tspan><tspan
         
         y="11.997"
         id="tspan178">300 m fra den pragtfulde Ristinge Strand. Øhavets </tspan><tspan
         
         y="23.993999"
         id="tspan180">bedste strand.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,653.9703)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text186"><tspan
         
         y="0"
         id="tspan184">Camping Mønbroen</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,639.1357)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text192"><tspan
         
         y="0"
         id="tspan188">Unik beliggenhed og naturskønne omgivelser er det, </tspan><tspan
         
         y="11.997"
         id="tspan190">der kendetegner Camping Mønbroen.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,599.3745)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text196"><tspan
         
         y="0"
         id="tspan194">Camping Rolighed</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,584.5399)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text206"><tspan
         
         y="0"
         id="tspan198">Hop en tur i den opvarmede swimmingpool, tag </tspan><tspan
         
         y="11.997"
         id="tspan200">en rask cykeltur i den smukke natur eller gå en tur </tspan><tspan
         
         y="23.993999"
         id="tspan202">ved vores eget søområde, hvor I finder den store </tspan><tspan
         
         y="35.991001"
         id="tspan204">krondyrfarm.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,520.7786)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text210"><tspan
         
         y="0"
         id="tspan208">Camping Tornby Strand</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,505.944)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text220"><tspan
         
         y="0"
         id="tspan212">Camping Tornby Strand tilbyder alle muligheder for </tspan><tspan
         
         y="11.997"
         id="tspan214">naturelskere i de rolige og idylliske omgivelser. Fra </tspan><tspan
         
         y="23.993999"
         id="tspan216">pladsen er der få minutters gang til Vesterhavet og </tspan><tspan
         
         y="35.991001"
         id="tspan218">den dejlige sandstrand.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,442.1828)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text224"><tspan
         
         y="0"
         id="tspan222">Campinggården Boeslunde</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,427.3481)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text230"><tspan
         
         y="0"
         id="tspan226">Enestående tilplantet familieplads med perfekt læ og </tspan><tspan
         
         y="11.997"
         id="tspan228">adgang til skov og strand.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,387.587)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text234"><tspan
         
         y="0"
         id="tspan232">CampWest</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,372.7523)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text244"><tspan
         
         y="0"
         id="tspan236">Velkommen til campingpladsen i Eventyrets Land </tspan><tspan
         
         y="11.997"
         id="tspan238">CampWest – stedet for ferie. CampWest ligger i et </tspan><tspan
         
         y="23.993999"
         id="tspan240">utrolig dejligt naturområde. Vi har skov, skovsø, hede </tspan><tspan
         
         y="35.991001"
         id="tspan242">og strand inden for kort afstand.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,308.9911)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text248"><tspan
         
         y="0"
         id="tspan246">Carlsberg Camping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,294.1565)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text258"><tspan
         
         y="0"
         id="tspan250">På toppen af Tåsinge, med en fantastisk udsigt </tspan><tspan
         
         y="11.997"
         id="tspan252">over det sydfynske øhav ligger campingpladsen. </tspan><tspan
         
         y="23.993999"
         id="tspan254">Indendørs legeland, svømmeland m.m. Luksushytter </tspan><tspan
         
         y="35.991001"
         id="tspan256">og campingvogne kan lejes.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,230.3953)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text262"><tspan
         
         y="0"
         id="tspan260">Darum Camping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,215.5606)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text272"><tspan
         
         y="0"
         id="tspan264">Naturskøn plads, der er etableret for over 50 år </tspan><tspan
         
         y="11.997"
         id="tspan266">siden. Der er mange gamle træer, hvilket giver gode </tspan><tspan
         
         y="23.993999"
         id="tspan268">læforhold, men også åbne pladser med mulighed for </tspan><tspan
         
         y="35.991001"
         id="tspan270">sol.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,151.7994)"
       style="font-variant:normal;font-weight:bold;font-stretch:normal;font-size:12px;font-family:'Frutiger 45 Light';-inkscape-font-specification:Frutiger-Bold;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text276"><tspan
         
         y="0"
         id="tspan274">Drejby Strandcamping</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,66.2736,136.9648)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text286"><tspan
         
         y="0"
         id="tspan278">Med pladsens ideelle beliggenhed på spidsen af Sydals </tspan><tspan
         
         y="11.997"
         id="tspan280">med Lillebælt og Østersøen på den ene side – og </tspan><tspan
         
         y="23.993999"
         id="tspan282">’Lillehavet’ på den anden – har du alle muligheder for </tspan><tspan
         
         y="35.991001"
         id="tspan284">en ferie i perfekte rammer.</tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,332.7303,760.3274)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text386"><tspan
         
         y="0"
         id="tspan380">Stressfri zone. Toprenoveret campingplads direkte ved </tspan><tspan
         
         y="11.997"
         id="tspan382">børnevenlig strand. Gåafstand til hyggelige Ebeltoft </tspan><tspan
         
         y="23.993999"
         id="tspan384">by. Kort afstand til Djurslands seværdigheder</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,332.7303,708.5662)"

         y="0"
         id="tspan388">Elitecamp Vestbirk</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,332.7303,693.7315)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text398"><tspan
         
         y="0"
         id="tspan392">Her trives børnene! Naturskøn plads med masser af </tspan><tspan
         
         y="11.997"
         id="tspan394">rum til hele familien. Her vil din ferie blive husket </tspan><tspan
         
         y="23.993999"
         id="tspan396">længe.</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,332.7303,641.9703)"

         id="tspan400">Enderupskov Camping</tspan></text>

       id="text412"><tspan
         
         y="0"
         id="tspan404">Familiedrevet campingplads til dig, som søger </tspan><tspan
         
         y="11.997"
         id="tspan406">atmosfære, god stemning, en uhøjtidelig omgangstone </tspan><tspan
         
         y="23.993999"
         id="tspan408">og sønderjysk lune i skønne omgivelser. Vores plads </tspan><tspan
         
         y="35.991001"
         id="tspan410">ligger smukt omkranset af skov.</tspan></text>
    <text

       id="text424"><tspan
         
         y="0"
         id="tspan418">Esbjerg Camping ligger i et skønt og stille naturområde, </tspan><tspan
         
         y="11.997"
         id="tspan420">med kort gåafstand til stranden og kort afstand til </tspan><tspan
         
         y="23.993999"
         id="tspan422">Esbjerg C.</tspan></text>
    <text

         y="11.997"
         id="tspan432">familiær atmosfære, pladsen ligger i smuk natur </tspan><tspan
         
         y="23.993999"
         id="tspan434">direkte ned til det sydfynske øhav. Udsigten er helt </tspan><tspan
         
         y="35.991001"
         id="tspan436">fantastisk ...</tspan></text>

         id="tspan446">der har lyst til sjov, leg, afslapning og familiehygge. </tspan><tspan
         
         y="23.993999"
